import { IgrRingSeriesBase } from "./igr-ring-series-base";
import { HierarchicalRingSeries } from "./HierarchicalRingSeries";
/**
 * Represents a
 * IgxDoughnutChartComponent hierarchical series.
*/
export class IgrHierarchicalRingSeries extends IgrRingSeriesBase {
    createImplementation() {
        return new HierarchicalRingSeries();
    }
    /**
                                 * @hidden
                                 */
    get i() {
        return this._implementation;
    }
    constructor(props) {
        super(props);
    }
    /**
     * Gets or sets the property name that contains the children items collection.
    */
    get childrenMemberPath() {
        return this.i.et;
    }
    set childrenMemberPath(v) {
        this.i.et = v;
    }
}
